use super::{
    property_ids::{lids::Lid, names::Name, tags::Tag, Pid},
    property_sets::PropertySet,
};
use crate::PType;

pub enum PropertyInfo {
    Lid {
        property_set: PropertySet,
        id: u32,
        p_type: PType,
    },
    Name {
        property_set: PropertySet,
        id: &'static str,
        p_type: PType,
    },
    Tag {
        id: u16,
        p_type: PType,
    },
}

impl PropertyInfo {
    pub fn p_type(&self) -> PType {
        match self {
            Self::Lid { p_type, .. } => *p_type,
            Self::Name { p_type, .. } => *p_type,
            Self::Tag { p_type, .. } => *p_type,
        }
    }
}

